import React from 'react';

export default function Welcome() {
  return (
    <section className="section auth">
      <div className="container">
        <h1>Bienvenido!</h1>
        <p>Creaste una nueva cuenta correctamente.</p>
        <p>Te hemos enviado un link a tu correo. Por favor entra a tu correo y verfica tu ceunta con un click en link.</p>
      </div>
    </section>
  )
}
